<script setup>

const wrapper = ref(null);
const logo = ref(null);

onMounted(() => {
  const letters = wrapper.value.querySelectorAll("g");

  const getRand = () => {
    return Math.floor(Math.random() * letters.length);
  }
  const replaceLetters = () => {
    letters.forEach(letter => {
      letter.children[1].classList.remove('visible');
      letter.children[0].classList.add('visible');
    });
    const count = Math.ceil(Math.random() * 4);
    for (let i = 0; i < count; i++) {
      const rand = getRand();
      letters[rand].children[1].classList.add('visible');
      letters[rand].children[0].classList.remove('visible');
    }
    setTimeout(replaceLetters, Math.round(Math.random() * 2000) + 500);
  }

  letters.forEach(letter => {
    letter.children[0].classList.add('visible');
  });
  
  replaceLetters();

  if(logo.value) logo.value.classList.add('visible');

});

</script>

